// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract TEX is ERC20, Ownable, Pausable {
    struct Proposal {
        uint id;
        address creator;
        string description;
        uint yesVotes;
        uint noVotes;
        mapping(address => bool) voted;
    }

    uint public proposalCount = 0;
    mapping(uint => Proposal) public proposals;

  constructor(uint256 initialSupply) ERC20("Fruittex Currency Token", "TEX") {
    _mint(msg.sender, initialSupply * (10 ** 5));
}

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        require(recipient != address(0), "TEX: transfer to the zero address");
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        require(recipient != address(0), "TEX: transfer to the zero address");
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), allowance(sender, _msgSender()) - amount);
        return true;
    }

    function burn(uint256 amount) public {
        _burn(_msgSender(), amount);
    }

    function mint(address recipient, uint256 amount) public onlyOwner {
        _mint(recipient, amount);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function createProposal(string memory description) public {
        proposalCount++;
        Proposal storage proposal = proposals[proposalCount];
        proposal.id = proposalCount;
        proposal.creator = msg.sender;
        proposal.description = description;
    }

    function vote(uint proposalId, bool yesVote) public {
        Proposal storage proposal = proposals[proposalId];
        require(!proposal.voted[msg.sender], "TEX: voter has already voted on this proposal");
        require(balanceOf(msg.sender) > 0, "TEX: voter has no tokens to vote with");

        if (yesVote) {
            proposal.yesVotes += balanceOf(msg.sender);
        } else {
            proposal.noVotes += balanceOf(msg.sender);
        }

        proposal.voted[msg.sender] = true;
    }

    function getProposal(uint proposalId) public view returns (uint id, address creator, string memory description, uint yesVotes, uint noVotes) {
        Proposal storage proposal = proposals[proposalId];
        return (proposal.id, proposal.creator, proposal.description, proposal.yesVotes, proposal.noVotes);
    }
}

